import React from "react";
import NavBarAuth from "./NavBarAuth";


type NavBarProps = {
    drawAuth: boolean;
};

const NavBar = ({ drawAuth }: NavBarProps) => {
    return (
        <nav className="navbar navbar-expand justify-content-between main-navbar">
            
            {drawAuth && <NavBarAuth />}
        </nav>
    );
};

export default NavBar;
